import React from 'react';
import styled from 'styled-components';
const Header = () => {
    return (
        <HeaderStyled>
            <h1>Page Header</h1>
            <h2>Sub Header</h2>
            <h3>Sub Sub Header</h3>
        </HeaderStyled>
    );
}

export default Header;

const HeaderStyled = styled.header`
    h1 {
        background-color: blue;
        font-size: 36px;
    }
    h2 {
        background-color: green;
    }
    h3 {
        background-color: orange;
    }

`;
